script: |
  super -f text -I q1695.spq | sort > q1695.out

inputs:
  - name: q1695.spq
    data: |
      SELECT + SUM ( 15 ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN + col2 / - 46 * 95 * col0 - - + col2 AND col2 + + - col0;
  - name: tab1

outputs:
  - name: q1695.out
    data: |
      45
